    false,nt"url": null,nt"notes": "Samples were collected in 1991 and 1992
    from massive Porites corals in Madang Lagoon (5 deg 13 minS; 145 deg 49 min E, .2M
    Depth) and at Duranguit Reef, Laing Island (4deg 9 min S; 144 deg 53 min E; 3M Depth),
    Bismark Sea coast, Papua New Guinea. The isotope record displays a marked seasonality,
    with an average annual range of 0.3-0.4% and as much as 0.8% PDB. Smoothed coral
    18O records are correlated with both Madang rainfall and Tahiti-Darwin SOI.",nt"license_title":
